INSERT INTO `jk_info` VALUES ('41', '2018-03-09 08:50:27', null, '', '0', '0', 'GNC系统规则', '', '', '<p>\r\n	为了给所有会员提供一个公平的创业环境，平台不参与任何交易，但会严格监管，请大家遵循系统运行规则：\r\n</p>\r\n<p>\r\n	<strong><span style=\"color:#006600;font-size:16px;\">注册规则</span></strong> \r\n</p>\r\n<p>\r\n	禁止多账号注册和操作，每位会员只能注册操作一个账号；\r\n</p>\r\n<p>\r\n	新注册会员送一台微型矿机，交易需完善资料等待后台审核通过后即可交易买卖.<br />\r\n送的或购买的矿机需在我的矿机点运行后自动运行，每小时自动结算，在个人中心点：矿机收益 后自动到帐！\r\n</p>\r\n<p>\r\n	<span style=\"color:#006600;font-size:16px;\"><strong>交易规则</strong></span> \r\n</p>\r\n<p>\r\n	禁止虚假交易，所有交易必须有真实的交易凭证；<br />\r\n交易匹配成功后联系买卖家核实交易。<br />\r\n交易开盘时间每天8:00到23:00\r\n</p>\r\n<p>\r\n	交易订单匹配后要在24小时以内完成付款；\r\n</p>\r\n<p>\r\n	付款完成后要在12小时内确认收款；\r\n</p>\r\n<p>\r\n	交易中必须使用个人资料内填写的支付宝和收款账号支付宝进行交易（否则视为虚假交易双方封号）；\r\n</p>\r\n<p>\r\n	系统规则请所有会员共同遵守，<span style=\"color:#006600;\"><strong>违反规则被其他会员投诉或被平台检测到，将永久冻结账号！<br />\r\n<span> </span></strong></span> \r\n</p>\r\n<p style=\"margin-left:0in;\">\r\n	<strong>GNC交易中心使用P2P的概念，用户之间的所有交易都是点对点定向交易，平台作为第三方只负责交易信息的匹配和交易过程的监督，确保每一位用户的资金安全，但不参与交易的任何环节。</strong> \r\n</p>\r\n<strong><span></span><span></span> \r\n<p>\r\n	<span font-size:16px;background-color:#efeff4;?=\"\" style=\"color: rgb(51, 51, 51);\">平台将收取卖方20%的交易佣金作为网络创业基金，</span>GNC交易中心于2018年03月15日上线。\r\n</p>\r\n<br />\r\n</strong> \r\n<p>\r\n	<br />\r\n</p>', '', '0', '0', '0', null, null, '0');
INSERT INTO `jk_info` VALUES ('42', '2018-03-09 08:45:04', null, '', '0', '0', '注册登陆流程', '', '', '<p>\r\n	进入【公会招募】将您的注册链接或二维码图片发送给需要注册的人\r\n</p>\r\n<p>\r\n	<span>打开注册链接或扫描二维码图片进入注册页面</span> \r\n</p>\r\n<p>\r\n	<span>正确填写资料进行注册</span> \r\n</p>\r\n<p>\r\n	进入登陆页面或APP登陆会员后台\r\n</p>\r\n<p>\r\n	<span>登陆后请进入个人中心-个人资料完善资料，等待激活后后即可交易！</span> \r\n</p>\r\n<p>\r\n	<strong><span style=\"color:#006600;\">如有任何问题您可以通过个人中心-旷工公会，进群交流</span></strong> \r\n</p>', '', '0', '0', '0', null, null, '0');
INSERT INTO `jk_info` VALUES ('43', '2018-03-09 16:06:58', null, '', '0', '0', '交易中心（买入GNC）（卖出GNC）', '', '', '<p>\r\n	<span style=\"color:#006600;font-size:16px;\"><strong>买入GNC（一）<br />\r\n开盘交易时间每天8:00-23:00</strong></span> \r\n</p>\r\n<p>\r\n	<span>挂单成功等待其他会员点击卖出</span> \r\n</p>\r\n<p>\r\n	<span>其他会员点击卖出后会提示交易中</span> \r\n</p>\r\n<p>\r\n	<span>您可以到个人中心-我的交易-交易列表，查看对方信息并向对方收款账户付款，付款成功后点击上传图片，上传付款凭证</span> \r\n</p>\r\n<p>\r\n	<span>上传交易凭证成功后，联系对方确认完成交易</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:16px;color:#006600;\">买入GNC（二）</span></strong><span style=\"font-size:16px;color:#006600;\"></span> \r\n</p>\r\n<p>\r\n	进入交易中心-卖入页面，点击卖出列表内等待卖出的订单\r\n</p>\r\n<p>\r\n	<span>查看成交价格，点击确认</span> \r\n</p>\r\n<p>\r\n	<span>匹配成功后请到个人中心-我的交易-交易列表，查看对方信息并向对方收款账户付款，付款成功后点击上传图片，上传付款凭证</span> \r\n</p>\r\n<p>\r\n	<span>上传交易凭证成功后，联系对方确认完成交易</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#006600;\">如交易中遇见欺诈行为，请点击投诉按钮向平台投诉。</span></strong> \r\n</p>', '', '0', '0', '0', null, null, '0');
INSERT INTO `jk_info` VALUES ('45', '2018-03-09 09:47:26', null, '', '0', '0', '矿工公会', '', '', '<p class=\"MsoNormal\">\r\n	作为一个GNC用户，不仅可以购买自己的专属矿机，还可以组建自己的矿工公会，构建矿机网络，由于我们的算法当中采用大量的P2P并行技术，越多的矿机组成的网络，其生产力就越强，不是简单的叠加，而是倍增的关系，所以我们鼓励所有的GNC用户组建自己的矿工公会，通过矿机网络获得更多的算力加成，生产更多的GNC！\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"color:#006600;\">GNC</span></b><b><span style=\"color:#006600;\">矿工</span></b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	首先您需有一台矿机，这时您就成为了GNC矿工，您可以邀请A购买一台矿机，这时A的矿机会连接到您的矿机上，通过并行算法，为您提供5%的算力收益（当A获得一定数量的GNC时，您将获得5%的GNC）。 您可以继续邀请B、C或更多的朋友购买矿机，和您的矿机组成矿机网络以获得更多的算力收益（一级矿机网络5%的算力收益），如果您的矿机的算力低于和您连接的A的算力，会因为您的矿机在矿机网络中的数据传输量不足，您只能获得A为您提供的算力收益的50%。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"color:#006600;\">公会会长</span></b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	当您邀请20个或以上的朋友和您组成了矿机网络，您的矿工公会GNC矿工达到1000人，公会矿机总算力达到25GH/s，您就升级为公会会长，获得云矿机1台微型，享受GNC交易佣金5%的全球分红。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"color:#006600;\">创业大使</span></b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	当您直接推荐的会员有5个或以上的会员成为了公会会长，您的公会矿机总算力达到50GH/s，您就升级为创业大使，获得小型云矿机1台，享受GNC交易佣金8%的全球分红。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"color:#006600;\">环保大使</span></b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	当您直接推荐的会员有3个或以上的会员成为了创业大使，您的公会矿机总算力达到100GH/s，您就升级为环保大使，获得中型云矿机1台，享受GNC交易佣金10%的全球分红。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"color:#006600;\">国际大使</span></b> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n	当您直接推荐的会员有3个或以上的会员成为了环保大使，您的公会矿机总算力达到1000GH/s，您就升级为国际大使，获得大型云矿机1台，享受GNC交易佣金15%的全球分红。\r\n</p>', '', '0', '0', '0', null, null, '0');
INSERT INTO `jk_info1` VALUES ('48', '2018-03-09 16:24:20', null, '', '0', '0', '上线通知', '', '', '<strong> \r\n<p>\r\n	一：注册即送矿机！二：平台不重酬卖矿机！三：平台不发行卖币，只靠会员注册送矿机和推广升级送矿机挖币（币稀缺）<br />\r\n<strong> </strong> \r\n</p>\r\n<p>\r\n	<strong>GNC交易中心将于2018年03月15日正式上线，初始价为0.45元/GNC，保持每天平稳上涨！</strong> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n</strong>', '', '0', '0', '0', null, null, '0');
